{c_label}分解{/c}
アイテムを作成用素材に分解します。
金床を{icon:lmb}してから分解したいアイテムを{icon:lmb}します。
{c_warning}一度分解したアイテムは元に戻せないので注意が必要です！{/c}

{c_gold}タウン・ポータル{/c_gold}
町に移動することができます。
（{HOTKEY}）で使用します。

悪夢の紋章を使えば、普通のダンジョンをナイトメア・ダンジョンへと変えることができます。

この作成により、{s1}の悪夢の紋章ができあがります。

